import React from "react";
import Banner from '../Banner/Banner';
import pic1 from '../../../Assets/Images/pc.png';
import pic2 from '../../../Assets/Images/awards.png';
import pic3 from '../../../Assets/Images/repairBanner.png';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faTools } from '@fortawesome/free-solid-svg-icons';
import styles from './BannerMain.module.css';

const icon = <FontAwesomeIcon icon={faTools} />

const bannerMain = () => (
    <div className={styles.BannerMain}>
        <Banner img={icon} 
                label= 'Mobile Servicing'
                details= 'All kinds of smartphone service' />
        <Banner img={pic2} 
                label= 'Money Transfer'
                details='Sends money all over the world' />
        <Banner img={pic3} 
                label= 'Laptop and Mobile Parts'
                details='All kinds of laptop and smartphone accesories' />
    </div>
)

export default bannerMain;
